import "./App.css";
import Routers from "./components/Routes";
import { Routes, Route, BrowserRouter as Router } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Routers />}></Route>
      </Routes>
    </Router>
  );
}

export default App;
